import React, { Component } from "react";
import { motion, transform } from "framer-motion";
import { Link, Router } from "react-router-dom";

class HamburgerNav extends Component {
  state = {};
  render() {
    return (
      <motion.a
        initial="rest"
        whileTap="click"
        animate="rest"
        variants={anchorChange}
        href="#"
        style={{
          color: "black",
          textDecoration: "none",
          position: "relative",
          top: 20,
          display: "grid",
          gridTemplateRows: "10px 10px",
        }}
      >
        <div
          style={{ height: 4, width: 28, backgroundColor: "black" }}
          variants={lineOne}
        ></div>
        <div
          style={{
            height: 4,
            width: 28,
            backgroundColor: "black",
          }}
        ></div>
        <div
          variants={lineThree}
          style={{
            height: 4,
            width: 28,
            backgroundColor: "black",
          }}
        ></div>
      </motion.a>
    );
  }
}

export default HamburgerNav;
